//SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Create2.sol";
import "@openzeppelin/contracts/utils/Address.sol";
import "@openzeppelin/contracts/proxy/utils/Initializable.sol";
import "./NFT.sol";


contract Connection is Ownable {
    using EnumerableSet for EnumerableSet.AddressSet;
    using EnumerableSet for EnumerableSet.Bytes32Set;
    using Address for address;

    struct TokenInfo {
        uint256 tokenId;
        address owner;
        address creator;
        address tokenContractAddress;
        address contractOwner;
        string tokenURI;
        uint256 time;
    }

    struct NFTInfo {
        address celebrity;
        address contractAddress;
        EnumerableSet.AddressSet creators;
        uint256 supplied;
    }

    struct Pool {
        address celebrity;
        address creator;
        string tokenURI;
        address _hash;
        uint256 open;
        uint256 close;
        uint256 cancel;
        uint256 reject;
        uint256 depositedValue;
    }

    // Declare a set state variable
    EnumerableSet.AddressSet private _celebrities;
    EnumerableSet.AddressSet private _creators;
    EnumerableSet.AddressSet private _hashes;

    mapping(address => NFTInfo) private _NFTInfos;
    mapping(address => Pool) private _pools;
    uint256 private _withdrawableValue;
    string private _initialTokenURI;
    uint256 private _mintingFee;

    event Mint(address celebrity, address creator, string tokenURI,
        address contractAddress, uint256 tokenId, uint256 time);

    constructor(string memory initialTokenURI, uint256 mintingFee) Ownable() {
        _withdrawableValue = 0;
        _initialTokenURI = initialTokenURI;
        _mintingFee = mintingFee;
    }

    modifier onlyCelebrity() {
        require(_celebrities.contains(msg.sender));
        _;
    }

    function setInitialTokenURI(string memory initialTokenURI) public onlyOwner {
        _initialTokenURI = initialTokenURI;
    }

    function register(address celebrity, address contractAddress) public onlyOwner {
        _NFTInfos[celebrity].celebrity = celebrity;
        _NFTInfos[celebrity].contractAddress = contractAddress;
        _NFTInfos[celebrity].supplied = 0;
        _celebrities.add(celebrity);
    }


    function isCelebrity(address celebrity) public view returns (bool) {
        return _NFTInfos[celebrity].celebrity == celebrity;
    }

    function requestNFT(string memory tokenURI, address celebrity) public payable {
        require(
            _NFTInfos[celebrity].celebrity == celebrity,
            "Celebrity does not exist"
        );
        require(msg.value == 1 ether, "Value is invalid");
        require(tx.origin == msg.sender, "tx.origin is not msg.sender");
        createPool(celebrity, tokenURI);
    }


    function approveNFT(string memory tokenURI) public payable onlyCelebrity {
        require(msg.value == 1 ether, "Value is invalid");
        require(tx.origin == msg.sender, "tx.origin is not msg.sender");

        address _hash = address(
            uint160(uint256(keccak256(abi.encode(tokenURI))))
        );
        require(
            _pools[_hash].celebrity == msg.sender,
            "You are not the owner of NFT"
        );
        require(_pools[_hash].open != 0, "Request is not opened yet");
        require(_pools[_hash].close == 0, "Request is already closed");
        require(_pools[_hash].cancel == 0, "Request is already canceled");
        require(_pools[_hash].reject == 0, "Request is already rejected");
        closePool(_hash, tokenURI);
    }


    function rejectNFT(string memory tokenURI) public onlyCelebrity {
        require(tx.origin == msg.sender, "tx.origin is not msg.sender");

        address _hash = address(
            uint160(uint256(keccak256(abi.encode(tokenURI))))
        );
        require(
            _pools[_hash].celebrity == msg.sender,
            "You are not the owner of NFT"
        );
        require(_pools[_hash].open != 0, "Request is not opened yet");
        require(_pools[_hash].close == 0, "Request is already closed");
        require(_pools[_hash].cancel == 0, "Request is already canceled");
        require(_pools[_hash].reject == 0, "Request is already rejected");
        rejectPool(_hash);
    }


    function cancelNFT(string memory tokenURI) public {
        require(tx.origin == msg.sender, "tx.origin is not msg.sender");

        address _hash = address(
            uint160(uint256(keccak256(abi.encode(tokenURI))))
        );
        require(
            _pools[_hash].creator == msg.sender,
            "You are not the owner of NFT"
        );
        require(_pools[_hash].open != 0, "Request is not opened yet");
        require(_pools[_hash].close == 0, "Request is already closed");
        require(_pools[_hash].cancel == 0, "Request is already canceled");
        require(_pools[_hash].reject == 0, "Request is already rejected");
        cancelPool(_hash);
    }


    function withdraw() public onlyOwner {
        address _owner = owner();
        Address.sendValue(payable(_owner), _withdrawableValue);
        _withdrawableValue = 0;
    }

    function poolHistory() public view returns (Pool[] memory) {
        address[] memory hashes = _hashes.values();
        uint256 counter = 0;
        uint256 count = 0;
        for (uint256 i = 0; i < hashes.length; i++) {
            if (
                _pools[hashes[i]].creator == msg.sender ||
                _pools[hashes[i]].celebrity == msg.sender
            ) {
                count++;
            }
        }
        Pool[] memory pools = new Pool[](count);
        for (uint256 i = 0; i < hashes.length; i++) {
            if (
                _pools[hashes[i]].creator == msg.sender ||
                _pools[hashes[i]].celebrity == msg.sender
            ) {
                pools[counter] = _pools[hashes[i]];
                counter++;
            }
        }
        return pools;
    }

    function getAllNFTs() public view returns (TokenInfo[][] memory) {
        address[] memory celebrities = _celebrities.values();
        TokenInfo[][] memory tokenInfos = new TokenInfo[][](celebrities.length);
        for (uint256 i = 0; i < celebrities.length; i++) {
            NFT NFT_ = NFT(
                _NFTInfos[celebrities[i]].contractAddress
            );
            TokenInfo[] memory temp = new TokenInfo[](
                _NFTInfos[celebrities[i]].supplied
            );
            for (uint256 j = 0; j < _NFTInfos[celebrities[i]].supplied; j++) {
                uint256 tokenId = j + 1;
                temp[j].tokenId = tokenId;
                temp[j].owner = NFT_.ownerOf(tokenId);
                temp[j].creator = NFT_.creatorOf(tokenId);
                temp[j].tokenContractAddress = address(NFT_);
                temp[j].contractOwner = NFT_.owner();
                temp[j].tokenURI = NFT_.tokenURI(tokenId);
                address _hash = address(
                    uint160(uint256(keccak256(abi.encode(temp[j].tokenURI))))
                );
                temp[j].time = _pools[_hash].close;
            }
            tokenInfos[i] = temp;
        }
        return tokenInfos;
    }

    function getOwnedNFTs() public view returns (TokenInfo[][] memory) {
        address[] memory celebrities = _celebrities.values();
        TokenInfo[][] memory tokenInfos = new TokenInfo[][](celebrities.length);
        for (uint256 i = 0; i < celebrities.length; i++) {
            NFT NFT_ = NFT(
                _NFTInfos[celebrities[i]].contractAddress
            );
            uint256 count = 0;
            for (uint256 j = 0; j < _NFTInfos[celebrities[i]].supplied; j++) {
                if (NFT_.ownerOf(j + 1) == msg.sender) {
                    count++;
                }
            }
            if (count == 0) {
                continue;
            }
            uint256 idx = 0;
            TokenInfo[] memory temp = new TokenInfo[](count);
            for (uint256 j = 0; j < _NFTInfos[celebrities[i]].supplied; j++) {
                if (NFT_.ownerOf(j + 1) != msg.sender) {
                    continue;
                }
                temp[idx].tokenId = idx + 1;
                temp[idx].owner = NFT_.ownerOf(idx + 1);
                temp[idx].creator = NFT_.creatorOf(idx + 1);
                temp[idx].tokenContractAddress = address(NFT_);
                temp[idx].contractOwner = NFT_.owner();
                temp[idx].tokenURI = NFT_.tokenURI(idx + 1);
                idx++;
                address _hash = address(
                    uint160(uint256(keccak256(abi.encode(temp[j].tokenURI))))
                );
                temp[j].time = _pools[_hash].close;
            }
            tokenInfos[i] = temp;
        }
        return tokenInfos;
    }

    function getNFTByContractAddress(address contractAddress) public view returns (TokenInfo[] memory) {
        address[] memory celebrities = _celebrities.values();
        address celebrity;
        uint256 tokenCount;
        for (uint256 i = 0; i < celebrities.length; i++) {
            if (_NFTInfos[celebrities[i]].contractAddress == contractAddress) {
                celebrity = celebrities[i];
                tokenCount = _NFTInfos[celebrities[i]].supplied;
                break;
            }
        }
        TokenInfo[] memory tokenInfos = new TokenInfo[](tokenCount);
        for (uint256 i = 1; i <= tokenCount; i++) {
            NFT NFT_ = NFT(contractAddress);
            TokenInfo memory tokenInfo;
            tokenInfo.contractOwner = celebrity;
            tokenInfo.creator = NFT_.creatorOf(i);
            tokenInfo.tokenContractAddress = contractAddress;
            tokenInfo.tokenId = i;
            tokenInfo.tokenURI = NFT_.tokenURI(i);
            tokenInfo.owner = NFT_.ownerOf(i);
            tokenInfos[i - 1] = tokenInfo;
        }
        return tokenInfos;
    }

    function createPool(address celebrity, string memory tokenURI) internal {
        address _hash = address(
            uint160(uint256(keccak256(abi.encode(tokenURI))))
        );
        require(
            _pools[_hash].celebrity == address(0),
            "TokenURI is duplicated"
        );
        Pool memory pool;
        pool.celebrity = celebrity;
        pool.creator = msg.sender;
        pool.tokenURI = tokenURI;
        pool._hash = _hash;
        pool.open = block.timestamp;
        pool.depositedValue = msg.value;
        _pools[_hash] = pool;
        _hashes.add(_hash);
    }

    function closePool(address _hash, string memory tokenURI) internal {
        Pool memory pool = _pools[_hash];

        address contractAddress = _NFTInfos[pool.celebrity].contractAddress;
        address creator = _pools[_hash].creator;

        NFT NFT_ = NFT(contractAddress);
        NFT_.mintNFT(tokenURI, creator);

        _pools[_hash].close = block.timestamp;
        _NFTInfos[pool.celebrity].creators.add(creator);
        _NFTInfos[pool.celebrity].supplied = NFT_.totalSupply();
        _withdrawableValue += msg.value;
        _withdrawableValue += _pools[_hash].depositedValue;
        _pools[_hash].depositedValue = 0;
        emit Mint(pool.celebrity, pool.creator, tokenURI, contractAddress, NFT_.totalSupply(), block.timestamp);
    }

    function rejectPool(address _hash) internal {
        address creator = _pools[_hash].creator;
        _pools[_hash].reject = block.timestamp;
        Address.sendValue(payable(creator), _pools[_hash].depositedValue);

        _pools[_hash].depositedValue = 0;
    }

    function cancelPool(address _hash) internal {
        address creator = _pools[_hash].creator;
        _pools[_hash].cancel = block.timestamp;
        Address.sendValue(payable(creator), _pools[_hash].depositedValue);
        _pools[_hash].depositedValue = 0;
    }
}
